(5149,	1,	'admin/privacy_policies/2',	'PUT',	'49.205.80.143',	'{\"privacy_policy_type_id\":\"1\",\"title\":\"Please read the Terms carefully and make sure that you understand them before placing an order.\",\"description\":\"In Care2Home, customers need to provide prescription image for some medicines to buy. In case of any wrong or damage your product must be reported to mrpharmanapp@gmail.com with in 24 hours. Failure to report on right time we don\'t take any responsibility. Compensation shall be provided inform of services and no cash will be given to customers.   Customer might get regular updates through calls\\/ SMS\\/ emails\\/ App notification.\\r\\n\\r\\nThis privacy policy describes how we handle the personal information which we collect through our app.\\r\\nWhat personal information we collect:\\r\\n\\r\\n* Identity data such as Name and images \\r\\n* Contact information including email\\r\\n* Address \\r\\n* Other information relevant to customer surveys and\\/or offers.\\r\\n\\r\\nWhat we do with your personal information:\\r\\n\\r\\nIn particular for the following reasons:\\r\\n* Record keeping \\r\\n* To view your order History. \\r\\n* we may use the information to improve our service.\",\"status\":\"1\",\"_token\":\"MrgEwyX0HwU8APBmeEWJlOcAXHfr8NWtkhdmjYSM\",\"_method\":\"PUT\",\"_previous_\":\"http:\\/\\/c2h_v2_dev.demoproducts.in\\/admin\\/privacy_policies\"}',	'2022-12-28 10:23:05',	'2022-12-28 10:23:05'),
