(8417,	1,	'admin/blog/2',	'PUT',	'49.205.86.128',	'{\"title\":\"7 Foods That Reduce Bloating\\u2014and 5 That Cause It\",\"description\":\"If you feel uncomfortably bloated after meals, it might be time to look at the types of foods you are eating. We asked a nutritionist for the top foods that lead to bloat, plus the seven best foods you should eat to reduce uncomfortable bloat and gas.\\r\\n\\r\\n01\\r\\nof 13\\r\\nWorst: Broccoli, Cabbage, and Kale\\r\\nKale, broccoli, and cabbage are cruciferous vegetables and contain raffinose\\u2014a sugar that remains undigested until bacteria in your gut ferment it. That produces gas and makes you bloat. However, eating them more often can actually help in the long run. \\\"Consistently eating nutrient-rich, high-fiber foods leads to having a stronger, healthier digestive system that\'s less prone to bloating,\\\" said Cynthia Sass, RD, Health contributing nutrition editor.\\r\\n\\r\\nSo keep eating the green veggies, but limit your portions. And if you absolutely can\'t part ways with even a gram of kale, steam it: \\\"Cooking any vegetable softens the fiber and shrinks the portion as some of the water cooks out, so it takes up less space in the GI tract,\\\" Sass said. It won\'t eliminate or prevent bloating altogether, but it may make your veggies easier to digest.\\r\\n\\r\\n02\\r\\nof 13\\r\\nWorst: Legumes\\r\\nBeans\\u2014along with lentils, soybeans, and peas\\u2014 are known as gas-causing foods. Although they contain more than enough protein, they also contain sugars and fibers that our bodies can\'t absorb. So when legumes reach the large intestine, your gut bacteria take the lead and feast on them. This process leads to gas, which can balloon your waist.\\r\\n\\r\\nCombine legumes with easily digestible whole grains, like rice or quinoa. Your body will eventually get used to them. \\\"If you eat fruits, veggies, nuts, whole grains, and beans often, they won\'t bother you as much as if you eat them sporadically,\\\" Sass said.\\r\\n\\r\\n03\\r\\nof 13\\r\\nWorst: Dairy\\r\\nIf you feel gassy after a few slices of cheese or a bowl of cereal with milk, you may be lactose intolerant\\u2014which means your body lacks the necessary enzymes to break down lactose (the sugar found in dairy products). When that occurs, according to a June 2022 Mbio study, it can cause gas to form in the GI tract, which may trigger bloating.\\r\\n\\r\\nSo before all that gas gets to you, steer clear of dairy products and opt for the many lactose-free or nondairy alternatives out there. The American Gastroenterological Association (AGA) also suggested the use of lactase tablets like Lactaid, which help people digest foods that contain lactose.\\r\\n\\r\\n04\\r\\nof 13\\r\\nWorst: Apples\\r\\nHigh in fiber, apples also contain fructose and sorbitol, sugars found in fruits that many people can\'t tolerate, Sass said\\u2014which leads to gas and the inevitable puffy feeling.\\r\\n\\r\\nApples are a great snack, however, so don\'t give up on them altogether. \\\"Eating apples specifically has been linked to a lower risk of heart disease and respiratory problems, including asthma, bronchitis, and emphysema,\\\" Sass explained. Eat them in moderation and separately from meals, and time your eating right: \\\"If you\'ll be wearing a form-fitting outfit or bathing suit, you might not want to reach for an apple,\\\" Sass said. Other fruits that bloat are pears, peaches, and prunes.\\r\\n\\r\\n05\\r\\nof 13\\r\\nWorst: Salty Foods\\r\\nEating high-sodium foods can trigger water retention, which can balloon you up, Sass said.\\r\\n\\r\\nAvoiding sodium isn\'t as simple as not using the saltshaker, however. The CDC reported that about 90% of Americans consume more sodium than is recommended for a healthy diet (2,300 mg per day for most people, and 1,500 mg for adults over 50, plus people with diabetes, high blood pressure, and high risk of hypertension).\\r\\n\\r\\nSodium sneaks its way into most processed and packaged foods, including soups, breads, and these other surprisingly salty fast foods. That makes it very difficult to avoid. When and if you do end up eating a lot of salty food, drink a lot of water to help flush out the salt.\\r\\n\\r\\n06\\r\\nof 13\\r\\nBest: Cucumber\\r\\nPeople use cucumbers to reduce puffiness under their eyes\\u2014and you can eat them to do the same thing for your belly. The vegetable contains quercetin, a flavonoid antioxidant that helps reduce swelling, Sass said.\\r\\n\\r\\n\\\"Cucumbers have been shown to inhibit the activity of pro-inflammatory enzymes,\\\" Sass added. So slice it up and eat it as is, or swap sugary drinks with a glass of cucumber water.\\r\\n\\r\\n07\\r\\nof 13\\r\\nBest: Bananas\\r\\nFoods rich in potassium\\u2014like bananas, plus avocados, kiwis, oranges, and pistachios\\u2014prevent water retention by regulating sodium levels in your body and can thus reduce salt-induced bloating. Bananas also have soluble fiber, which can relieve or prevent constipation.\\r\\n\\r\\n\\\"Bloating can also be caused by constipation,\\\" Sass said. \\\"If you\'re not able to eliminate waste in the GI tract, you become \'backed up\' so to speak, which can lead to a bloated look.\\\"\\r\\n\\r\\n08\\r\\nof 13\\r\\nBest: Papaya\\r\\nAccording to a December 2020 IOP Conference Series: Earth and Environmental Science paper, papain (the enzyme in papaya) helps break down proteins in your GI system, which makes digestion easier. Sass said that the tropical fruit also has anti-inflammatory properties, as well as fibers that support a strong digestive tract. Eat papaya whole and fresh or blended into a smoothie.\\r\\n\\r\\n09\\r\\nof 13\\r\\nBest: Asparagus\\r\\nAsparagus is an anti-bloating superfood: It helps you to urinate, which flushes all that excess water to relieve any discomfort and bloat.\\r\\n\\r\\nIt also contains prebiotics, which help support the growth of \\\"good\\\" bacteria, according to Sass. This helps maintain a healthy balance in your digestive system to prevent or reduce gas.\\r\\n\\r\\nFinally, the vegetable contains soluble and insoluble fibers, which helps promote overall digestive health.\\r\\n\\r\\n10\\r\\nof 13\\r\\nBest: Yogurt With Probiotics\\r\\nProbiotics, which are good bacteria in your gut, help regulate digestion and champion the overall health of your digestive tract. You can take probiotic supplements, but you may as well get a breakfast out of it. So eat your bloat away with yogurt that has active cultures. If you want to add some sweetness, use a little honey, jam, or granola.\\r\\n\\r\\n11\\r\\nof 13\\r\\nBest: Fennel Seeds\\r\\nFennel does wonders for your digestive tract\\u2014especially since you can gain benefits from multiple parts of the vegetable. The seeds have a compound that relaxes GI spasms, which allows gas to pass and relieve bloating, Sass said. You can also chew on the seeds directly or sip on a fennel tea at the end of a meal.\\r\\n\\r\\n12\\r\\nof 13\\r\\nBest: Ginger\\r\\nGinger contains the digestive enzyme zingibain. which helps your digestive system break down protein. The compound potentially helps food be digested more easily, reducing bloat, gas, or constipation.\\r\\n\\r\\nIf you already feel bloated, you probably don\'t want to eat\\u2014so instead, sip homemade ginger tea: Steep a few slices of sliced ginger in a mug of hot water for five to 10 minutes.\\r\\n\\r\\n13\\r\\nof 13\\r\\nBest: Peppermint and Chamomile Teas\\r\\nIf you\'re feeling puffy after dinner, you can sip on a hot cup of peppermint or chamomile tea. Both kinds relax GI muscles, per an April 2020 Journal of Medicinal Plants Studies article, to help dissipate the gas that causes your stomach to bloat. Aside from improving digestion, chamomile can also soothe and relax, which can help ease any sort of stomach discomfort.\",\"video\":\"https:\\/\\/vimeo.com\\/444676094\",\"_token\":\"jopocg1hYSG8cJx7LehgrWly9NFxyXD89c98rLDN\",\"_method\":\"PUT\",\"_previous_\":\"http:\\/\\/c2h_v2_dev.demoproducts.in\\/admin\\/blog\"}',	'2023-02-04 11:21:15',	'2023-02-04 11:21:15'),
