(1,	2,	'faq_categories/016049df6da3453419053c33a1e7a369.png',	'Appointments',	'The pre-timing of a patient visit to the hospital for consultation with a doctor.',	1,	'2022-02-18 12:43:48',	'2022-07-19 06:05:21'),
