(5,	1,	'faq_categories/b3c0c0f4e6c70a69f6b283e9ff248664.png',	'My Account',	'A patient or doctor profile is a collection of information that can be used in a decision analysis situation between the doctor, domain environment, and patient.',	1,	'2022-02-18 12:55:03',	'2022-07-19 06:06:52'),
(6,	3,	'faq_categories/c6b4f10caecb0aa1ee71b322c5984ec3.png',	'Appointments',	'Get personalized solutions for any health issue with instant online doctor consultation',	1,	'2022-02-20 12:08:17',	'2022-07-19 06:06:06'),
(7,	3,	'faq_categories/03b7cc4a05919d9ea1ed60fd0ee58ca9.png',	'My Account',	'Greater Efficiency, Accuracy and Cost Reduction. Reduce the Cost of Making Payments While Increasing Provider Satisfaction. Easy Implementation.',	1,	'2022-02-20 12:19:01',	'2022-07-19 06:09:17'),
(8,	3,	'faq_categories/9481adf0ab152b51c2980ec976b5407a.png',	'Earnings',	'Anyone that earns a doctorate can be called a doctor, but in modern usage.',	1,	'2022-02-20 12:27:31',	'2022-07-19 06:09:29'),
