INSERT INTO `lab_packages` (`id`, `lab_id`, `lab_relevance_id`, `tag`, `package_name`, `short_description`, `long_description`, `test_preparation`, `package_image`, `expected_delivery`, `price`, `is_popular`, `status`, `created_at`, `updated_at`) VALUES
(1,	1,	5,	1,	'Essential Heart Checkup',	'A bad lifestyle affects cardiac heath the most and the heart is the major organ in the human body that pumps the blood to the vessels.',	'Our mental health directly impacts our physical well-being. In todays day and age, while every individual is fighting their own battle, health invariably takes a back seat. Unhealthy lifestyle and stress contribute towards heart related disorders.  \r\nWith Essential heart checkup package understand the status of your heart health. Stay one step ahead, catch the symptoms early and start your treatment in time.',	'Get test samples picked up from your doorstep.',	'lab_packages/acd2b01c1fdd83836ef2dd8ce6f49ff8.jpg',	'week',	1000,	1,	1,	'2022-11-28 06:45:58',	'2022-12-21 16:12:54'),
(2,	2,	6,	2,	'Full Body Check up',	'The purpose of a full body checkup is to identify any potential health problems or risks early on, so that they can be treated or managed before they become more serious.',	'Full body checkups are generally recommended for people of all ages, but they may be particularly important for those who have a family history of certain health conditions, or who are at an increased risk of developing certain conditions due to lifestyle factors such as diet, exercise, and stress.\r\n\r\nOverall, a full body checkup is a valuable tool for maintaining good health and can help to identify and address any potential health issues before they become more serious.',	'Get test samples picked up from your doorstep.',	'lab_packages/9fece4cb6116e7c7d83cb5be3e4b90aa.jpg',	'week',	500,	1,	1,	'2022-12-21 16:09:41',	'2022-12-21 16:12:39'),
(3,	1,	3,	3,	'Full Body Check up',	'A full body checkup is a comprehensive health assessment that involves a series of medical tests and examinations to evaluate the overall health of an individual.',	'Full body checkups are generally recommended for people of all ages, but they may be particularly important for those who have a family history of certain health conditions, or who are at an increased risk of developing certain conditions due to lifestyle factors such as diet, exercise, and stress.\r\n\r\nOverall, a full body checkup is a valuable tool for maintaining good health and can help to identify and address any potential health issues before they become more serious.',	'Get test samples picked up from your doorstep.',	'lab_packages/69d1509194345c687b2f4cff79a0366b.jpg',	'week',	500,	1,	1,	'2022-12-21 16:11:13',	'2022-12-21 16:11:52'),
(4,	1,	6,	2,	'Full Body Check up',	'Overall, a full body checkup is a valuable tool for maintaining good health and can help to identify and address any potential health issues before they become more serious.',	'Overall, a full body checkup is a valuable tool for maintaining good health and can help to identify and address any potential health issues before they become more serious.',	'Get test samples picked up from your doorstep.',	'lab_packages/327b71a8a0106ff071fd79b2569b1c1a.jpg',	'week',	500,	1,	1,	'2022-12-21 16:28:18',	'2022-12-21 16:28:18'),
(5,	2,	1,	1,	'essential checkup',	'It typically includes a range of tests such as blood tests, urine tests, X-rays, and physical exams, as well as screenings for various conditions such as diabetes, high blood pressure, and cancer.',	'It typically includes a range of tests such as blood tests, urine tests, X-rays, and physical exams, as well as screenings for various conditions such as diabetes, high blood pressure, and cancer.',	'Get test samples picked up from your doorstep.',	'lab_packages/d0336b0abcf3b20ad218a058d7ac6657.jpg',	'week',	1000,	1,	1,	'2022-12-21 16:29:52',	'2022-12-21 16:29:52'),
(6,	2,	2,	3,	'essential checkup',	't can also help to establish a baseline of an individual\'s health, which can be used to monitor any changes over time.',	't can also help to establish a baseline of an individual\'s health, which can be used to monitor any changes over time.',	'Get test samples picked up from your doorstep.',	'lab_packages/a8c4348c71bb556aee95c5fd7b30e886.jpg',	'week',	500,	1,	1,	'2022-12-21 16:30:52',	'2022-12-21 16:30:52');
