(3,	2,	'6 tips to make a lasting impact in the medical field',	'6 tips to make a lasting impact in the medical field SHARYAR BARADARAN, DDS AND ARYA SHAMIE, MD PHYSICIAN  FEBRUARY 14, 2023  We were both born in Iran to renowned physicians fathers and were friends and classmates in elementary school until the Persian revolution hit in 1979. We both escaped Iran with our families, emigrated to Los Angeles, and have been friends ever since. Our experiences early in life provided us with the life lessons needed to find success, and we hope that by sharing our lessons, we can help impact the ',	'notification/6f1011b2ccd14ec4f582fdb33351ffed.png',	'2023-02-15 17:07:06',	'2023-02-15 17:07:06'),
