(4,	1,	4,	15,	'Johnson\'s Baby Skincare Wipes',	'softwave fabric for gentle softness and comfort',	'products/af223e6a745e3c252e2699ba08b51ee5.jpeg',	'Packs 3X weight of moisturizing lotion\r\nProvides soft & gentle care for newborn delicate skin and helps protect against redness & rash\r\n100% Clinically proven mild & gentle\r\nDermatologist tested, Allergy tested',	80,	100,	'5',	3,	1,	'2022-11-28 09:55:45',	'2022-11-28 09:58:58'),
(5,	1,	1,	6,	'Dettol Clinical Strength Hand Sanitizer',	'Alcohol, Kills 99.99% Germs',	'products/347ab9f520b214a25388d15a31fef514.jpg',	'broad spectrum antimicrobial: Kills 99.99% bacteria, viruses, and fungi\r\nsoft on hands: enriched with emollients and moisturizer, this sanitizer is soft on hands and keeps them moisturized',	100,	150,	'5',	2,	1,	'2022-11-28 10:46:31',	'2022-11-28 10:46:31'),
