(7,	1,	1,	8,	'Savlon Powder to Liquid Handwash',	'Empty bottle, Makes 200ml Liquid Germ Protection Handwash',	'products/e8d94889bb56ed16b9df4438d2e5d134.webp',	'Savlon Powder to Liquid Handwash is packed with the Germ Fighting Power of Savlon which provides 99.9% protection from germs\r\nIn 3 simple steps: WATER- POWDER-SHAKE, your liquid Savlon Handwash with its smooth texture & fresh fragrance is ready to use!\r\nEach pack of Savlon Powder Handwash makes 200ml liquid handwash that lasts for 120+ washes',	40,	45,	'2',	1,	1,	'2022-11-28 10:54:23',	'2022-11-28 10:54:23'),
(8,	1,	1,	9,	'Dettol Antiseptic Liquid',	'Surface Disinfection and Personal Hygiene',	'products/4294b7b7d8066af0e17604c29832a122.jpg',	'ANTISEPTIC LIQUID: Protects from 100 illness causing germs\r\nMULTIPURPOSE CLEANER: Great for everyday personal and home hygiene\r\nUSAGE: Ideal to be used for First Aid, cleaning cuts and wounds.\r\nDISINFECTANT LIQUID: Antiseptic Liquid used to disinfect household items and surfaces.\r\nDOCTOR RECOMMENDED: All Dettol products are recommended by the Indian Medical Association (IMA)\r\nsurface_recommendation: Skin, floor, Tile, fabric',	400,	450,	'5',	1,	1,	'2022-11-28 10:57:03',	'2022-11-28 10:57:03'),
(9,	1,	2,	11,	'Supradyn Immuno',	'Multivitamin Tablet with Natural Ingredients',	'products/0e4b4c6a5397093b69133d6cdf240829.webp',	'It is composed of ayurvedic herbs\r\nIt can help boost immunity\r\nIt may offer antioxidant benefits',	200,	239,	'2',	3,	1,	'2022-11-28 11:02:08',	'2022-11-28 11:03:28'),
(11,	1,	2,	12,	'Dr. Reddys Celehealth Nutritional Drink',	'Protein Supplement for Daily Use, Low Glycemic Index, Zero Added Sugar',	'products/5cf3834dcfeb3bd2317df5770c2f29ff.jpg',	'Celehealth is a daily use nutritional health drink formulated with ingredients that support bone and muscle health, aid healthy digestion, and support immunity.\r\nIts a plant and milk protein-based drink with Soy, Bengal gram and Ragi rich in fiber to support digestion. This health drink is enriched with nutrients that help in the maintenance of bone and muscle strength. It is a balanced nutrient-rich drink that provides energy and supports immunity on a regular basis.',	500,	572,	'2',	4,	1,	'2022-11-28 11:11:58',	'2022-11-28 11:11:58'),
(12,	1,	2,	13,	'Biotin Hair Gummies',	'100% Vegan Hair Vitamins with No Added Sugar',	'products/8003807bbb2ca74842c218c671935893.webp',	'Reduces hair fall & hair thinning\r\nStrengthens and thickens hair\r\n Reduces dry, dull & damaged hair',	450,	499,	'3',	3,	1,	'2022-11-28 11:13:45',	'2022-11-28 11:13:45'),
(13,	1,	2,	14,	'Mars Vitamin D3',	'400 IU + Calcium',	'products/f5d8e9fb309ac160a4e30c485ac6693a.webp',	'From improved bone density to stronger nails, these are just some of the many benefits of taking calcium & Vitamin D3 supplements.\r\n\r\nMars by GHC Plant-Based Vitamin D3 Supplement has calcium, magnesium & vitamin D, all of which are vital for bone strength.',	300,	399,	'5',	4,	1,	'2022-11-28 11:22:28',	'2022-11-28 11:22:28'),
(14,	1,	3,	21,	'Adderall',	'Adderall, Adderall XR, Mydayis',	'products/b2767f7de86797adb3cfd7c36cec9519.jpeg',	'Pill with imprint AD 30 is Orange, Round and has been identified as Adderall 30 mg. It is supplied by Shire US Inc.\r\n\r\nAdderall is used in the treatment of adhd; narcolepsy and belongs to the drug class CNS stimulants. Risk cannot be ruled out during pregnancy.',	70,	100,	'3',	3,	1,	'2022-11-28 11:44:08',	'2022-11-28 11:44:08'),
(15,	1,	3,	22,	'Chlorpromazine Tablets IP',	'Chlorpromazine Hydrochloride Tablets IP 25 mg Each Sugarcoated tablets',	'products/7c442c3c6f159c5368a12b088978e162.webp',	'A sugar-coated tablet is coated with sugar to disguise the taste. A sugar-coated tablet may taste sweeter than a film-coated tablet.',	60,	80,	'2',	3,	1,	'2022-11-28 11:47:19',	'2022-11-28 11:47:19'),
(16,	1,	3,	23,	'Protonix',	'Pantoprazole is used to treat certain stomach and esophagus problems',	'products/a41ea08c6d78c22541a75689d17666a4.jpeg',	'An enteric coating is a polymer barrier applied to oral medication that prevents its dissolution or disintegration in the gastric environment.',	40,	50,	'2',	3,	1,	'2022-11-28 11:50:38',	'2022-11-28 11:50:38'),
(17,	1,	3,	24,	'Vitamin-C 500 Chewable',	'Vitamin-C 500 Chewable Tablet 10\'s belongs to a class of medicines called nutritional supplements',	'products/015fdaf38957878b1db9d4da12681bd4.jpeg',	'Vitamin-C 500 Chewable Tablet 10\'s belongs to a class of medicines called nutritional supplements used to prevent and treat nutritional deficiencies and vitamin C deficiency. A nutritional deficiency occurs when the body does not absorb or get enough nutrients from food. Vitamins and minerals are necessary for body development and the prevention of diseases.',	70,	80,	'3',	3,	1,	'2022-11-28 11:54:00',	'2022-11-28 11:54:00'),
(18,	1,	4,	16,	'Pampers Baby Diapers - Dry, Small',	'Diapers & Wipes Baby Wipes Diapers Nappies & Rash Cream',	'products/0b4d042334479561b6595b73e9d62eaa.webp',	'Pampers baby-dry pants style diapers are the only pants in India with new Air Channels providing your baby with a new type of dryness overnight; breathable dryness\r\nA top layer with cotton-like soft material, for a comfortable nights sleep.\r\nThe new & improved product design enables a comfortable fit, closer to the babys body.',	80,	100,	'2',	3,	1,	'2022-11-28 11:55:59',	'2022-11-28 11:55:59'),
